"use strict";function addCookie(e,o,t){var n=new Date;n.setDate(n.getDate()+t),document.cookie="".concat(e,"=").concat(escape(o),";expires=").concat(n.toGMTString())}function getCookie(e){for(var o=unescape(document.cookie).split("; "),t=0;t<o.length;t++)if(0==o[t].indexOf(e+"="))return o[t].split("=")[1];return null}function removeCookie(e){addCookie(e,"byebye",-1)}function updateCookie(e,o,t){addCookie(e,o,t)}